create database Hollywood;

use Hollywood;

create table Proprietario(
ID_Proprietario integer auto_increment primary key,
CPF_CNPJ_Proprietario varchar(14) not null,
Nome_Proprietario varchar(50) not null,
Tipo Enum('CPF','CNPJ') not null
);

describe Proprietario;

create table Estudio_Cinematografico(
ID_Estudio integer auto_increment primary key,
Nome_Estudio varchar(30) not null,
Data_Fundacao date not null,
FK_ID_Proprietario integer not null,
foreign key (FK_ID_Proprietario) references Proprietario(ID_Proprietario)
);

describe Estudio_Cinematografico;

create table Rendimento_Estudio(
ID_Rendimento_Estudio integer auto_increment primary key,
Ano_Rendimento_Estudio varchar(4) not null,
Rendimento_Estudio decimal(12,2) not null,
FK_ID_Estudio integer not null,
foreign key (FK_ID_Estudio) references Estudio_Cinematografico(ID_Estudio)
);

describe Rendimento_Estudio;

create table Filme(
ID_Filme integer auto_increment primary key,
Nome_Filme varchar(30) not null,
Meses_Produção float,
Ano_Lancamento varchar(4),
Copyright varchar(20) not null unique,
Custo_Total_Filme decimal (12,2),
FK_ID_Estudio integer not null,
foreign key (FK_ID_Estudio) references Estudio_Cinematografico(ID_Estudio) 
);

describe Filme;

create table Ator(
ID_Ator integer auto_increment primary key,
Nome_Artistico varchar(50) not null,
Seguro_Social_Ator varchar(20) not null unique,
Nacionalidade_Ator varchar(20),
Data_Nascimento_Ator date not null,
Sexo_Ator enum('Masculino','Feminino')
);

describe Ator;

create table Tipo_Personagem(
ID_Personagem integer primary key auto_increment,
Tipo_Papel_Personagem varchar(200),
Tipo_Fisico_Personagem varchar(200),
FK_ID_Ator integer not null,
foreign key (FK_ID_Ator) references Ator(ID_Ator) 
);

describe Tipo_personagem;

create table Atuacao(
ID_Atuacao integer auto_increment primary key,
Cache_Atuacao decimal(9,2),
Nome_Personagem_Atuacao varchar(50),
FK_ID_Filme integer not null,
FK_ID_Ator integer not null,
foreign key (FK_ID_Filme) references Filme(ID_Filme),
foreign key (FK_ID_Ator) references Ator(ID_Ator)
);

describe Atuacao;

Alter table Proprietario modify column CPF_CNPJ_Proprietario varchar(18);


select * from Proprietario;
select * from Proprietario order by Tipo;
select * from Proprietario where Tipo = "CPF" order by ID_Proprietario;
select Nome_Proprietario as "Nome", CPF_CNPJ_Proprietario "Documento", Tipo from Proprietario where ID_Proprietario between 17 and 23;
select count(*) as "Contagem de registros", Tipo from Proprietario group by Tipo;
select Nome_Proprietario as "Nome", ID_Proprietario "Identificador" from Proprietario where Nome_proprietario like '%23%';
select Nome_Proprietario as "Nome" from Proprietario where Nome_Proprietario like '%Produções';


select * from Estudio_Cinematografico order by ID_Estudio;
select count(Estudio_Cinematografico.Nome_Estudio) as "Contagem de registros", Estudio_Cinematografico.FK_ID_Proprietario as "Identificador do proprietario", Proprietario.Nome_Proprietario as "Nome do proprietario" from Estudio_Cinematografico, Proprietario where Proprietario.ID_Proprietario = Estudio_Cinematografico.FK_ID_Proprietario group by Proprietario.ID_Proprietario;
Select Estudio_Cinematografico.Nome_Estudio as "Nome do estúdio", Proprietario.Nome_Proprietario as "Nome do proprietário" from Proprietario, Estudio_Cinematografico where Proprietario.ID_Proprietario = Estudio_Cinematografico.FK_ID_Proprietario;
select Nome_Estudio as "Nome do estúddio", Data_Fundacao as "Data de fundação" from Estudio_Cinematografico order by Data_Fundacao;
select Nome_Estudio as "Nome do estúdio", FK_ID_Proprietario as "Identificador do proprietário" from Estudio_Cinematografico where FK_ID_Proprietario < 10 order by FK_ID_Proprietario;
select max(Data_Fundacao) as "Data de fundação", Nome_Estudio from Estudio_Cinematografico;
select Data_Fundacao as "Data de fundação", Nome_Estudio as "Nome do estúdio" from Estudio_Cinematografico where Data_Fundacao < "1987/02/03";

Alter table Rendimento_Estudio modify column Ano_Rendimento_Estudio integer;


select * from Rendimento_Estudio;
select * from Rendimento_Estudio where Ano_Rendimento_Estudio = 2019 order by ID_Rendimento_Estudio;
select count(ID_Rendimento_Estudio), Ano_Rendimento_Estudio from Rendimento_Estudio group by Ano_Rendimento_Estudio order by Ano_Rendimento_Estudio;
select Rendimento_Estudio.Ano_Rendimento_Estudio, Rendimento_Estudio.Rendimento_Estudio, Proprietario.Nome_Proprietario, Proprietario.CPF_CNPJ_Proprietario, Estudio_Cinematografico.Nome_Estudio, Estudio_Cinematografico.Data_Fundacao from Proprietario inner join Estudio_Cinematografico on Estudio_Cinematografico.FK_ID_Proprietario = Proprietario.ID_Proprietario inner join Rendimento_Estudio on Rendimento_Estudio.FK_ID_Estudio = Estudio_Cinematografico.ID_Estudio order by Rendimento_Estudio.Ano_Rendimento_Estudio;
select avg(Rendimento_Estudio.Rendimento_Estudio), Proprietario.Nome_Proprietario, Proprietario.CPF_CNPJ_Proprietario, Proprietario.Tipo, Estudio_Cinematografico.Nome_Estudio, Estudio_Cinematografico.Data_Fundacao, Rendimento_Estudio.Rendimento_Estudio from Proprietario inner join Estudio_Cinematografico on Estudio_Cinematografico.FK_ID_Proprietario = Proprietario.ID_Proprietario inner join Rendimento_Estudio on Rendimento_Estudio.FK_ID_Estudio = Estudio_Cinematografico.ID_Estudio where FK_ID_Estudio  = 19;

Alter table Filme modify column Ano_Lancamento integer;
Alter table Filme modify column Nome_Filme varchar(100);
Alter table Filme modify column Copyright varchar(10);


select Filme.Nome_Filme, Filme.Ano_Lancamento, Filme.Copyright, Estudio_Cinematografico.Nome_Estudio, Proprietario.Nome_Proprietario from Estudio_Cinematografico inner join Filme on Estudio_Cinematografico.ID_Estudio = Filme.FK_ID_Estudio inner join Proprietario on Proprietario.ID_Proprietario = Estudio_Cinematografico.FK_ID_Proprietario;
select distinct(Ano_Lancamento) from Filme order by Ano_Lancamento;
select count(Nome_Filme), Ano_Lancamento from Filme group by Ano_Lancamento order by Ano_Lancamento;

alter table Ator modify column Seguro_Social_Ator varchar(10); 


select * from Ator;
select Nome_Artistico, Nacionalidade_Ator, Sexo_Ator from Ator order by Nacionalidade_Ator;


select * from Tipo_Personagem;
select Tipo_Personagem.Tipo_Fisico_Personagem, Tipo_Personagem.Tipo_Papel_Personagem, Ator.Nome_Artistico from Tipo_Personagem, Ator where Ator.ID_Ator = Tipo_Personagem.FK_ID_Ator;


select * from Atuacao;
select Ator.Nome_Artistico as "Nome do Ator", Filme.Nome_Filme as "Nome do Filme", Atuacao.Cache_Atuacao as "Cache recebido", Atuacao.Nome_Personagem_Atuacao "Nome do personagem" from Atuacao inner join Ator on Ator.ID_Ator = Atuacao.FK_ID_Ator inner join Filme on Filme.ID_Filme = Atuacao.FK_ID_Filme;
